import Book from './Book';
function Books({books}){
    
    return(
        <div id="book">
            <div className="container">
                <table>
                    <tr>
                        <td>title</td>
                        <td>Author</td>
                        <td>ISBN</td>
                        <td>Year</td>
                    </tr>
                    <tbody>
                    </tbody>
                </table>
                <ul className="bookItem">

                    {
                    books.map((book)=>(
                        <li key={book.isbn} ><Book book={book} /></li>
                    ))}
                    {/* <li><Book onOpen={list} title="this is a new book" author="Kimbi" isbn={2345343} year="12-34-2020" /></li>
                    <li><Book title="A brief History of Time" author="Stephen Hawkings" isbn={35225} year="12-34-2020" /></li>
                    <li><Book title="Man's not hot" author="John Doe" isbn={35225} year="12-34-2020" /></li> */}
                </ul>
                
            </div>
        </div>
    )
}

export default Books;
